var DatioRoutes=Backbone.Router.extend({routes:{"/":"home","/projects":"projects","/projects/add":"add_project","/projects/:id":"project","/projects/edit/:id":"edit_project","/settings":"settings","/plans":"plans","/docs":"docs"},initialize:function(){},home:function(){var c=$("#viewLayout");c.empty();var a=new datioscience.views.homeView();var b=a.render().el;c.html(b)},projects:function(){var d=$("#viewLayout");d.empty();var a=new datioscience.collections.Projects();a.fetch();var b=new datioscience.views.projectsView({collection:a});var c=b.render().el;d.html(c)},project:function(d){var c=$("#viewLayout");c.empty();var a=new datioscience.views.projectView({collection:[]});var b=a.render().el;c.html(b)},add_project:function(){var c=$("#viewLayout");c.empty();var a=new datioscience.views.newProjectView();var b=a.render().el;c.html(b)},edit_project:function(b){var a=new datioscience.models.Project({id:b});a.fetch({success:function(d,f){var e=$("#viewLayout");e.empty();switch(f.project_type){case"classification":var c=new datioscience.views.editClassificationProjectView({model:d}).render().el;e.html(c);break}},error:function(){}})},settings:function(){var a=$("#viewLayout");a.empty();console.log("hello welcome water")},plans:function(){var a=$("#viewLayout");a.empty();console.log("hello welcome water")},docs:function(){var a=$("#viewLayout");a.empty();console.log("hello welcome water")}});datioscience.sqr=new DatioRoutes();$(function(){Backbone.history.start({pushState:true});datioscience.sqr.navigate(window.location.pathname,{trigger:true})});$(window).keydown(function(a){if(a.ctrlKey&&a.keyCode==84){console.log("Hey! Ctrl+T event captured!");a.preventDefault()}if(a.ctrlKey&&a.keyCode==82){console.log("Hey! Ctrl+S event captured!");a.preventDefault()}});$(document).on("click",'a[href^="/"]',function(b){var a=$(b.currentTarget).attr("href");b.preventDefault();if(a==="/logout"){window.location="/logout"}else{datioscience.sqr.navigate(a,{trigger:true})}});